    function centerize(text, width) {
        var len = 0;
        var rec = width / 2; // the width of the rectangle where the score gets printed
        if (typeof text === "number") {
            len = Math.ceil(Math.log(text + 1) / Math.LN10); //total_score.toString.length always results to 1
        } else {
            len = text.length;
        }
        len = Math.floor(len / 2);
        return rec - len;
    }

