    function checkKeyDown(e) {
    	e.preventDefault();
    	var key = e.which || e.keyCode
    	if (key === 8 && keys_typed !== "") {
    		// backspace
    		keys_typed = cutWord(keys_typed, 1);
    	} else if (key === 39) {
    		// right arrow key
    		move_word_right = 10;
    	} else if (key === 37) {
    		// left arrow key
    		move_word_left = -10;
    	} else {
	    	keys_typed += String.fromCharCode(key).toLowerCase();
	    }
    }
    
    function checkKeyUp(e) {
    	e.preventDefault();
    }
    
    function cutWord(word, chars) {
    	var wlen = word.length;
    	word = word.substring(0, wlen - chars);
    	return word;
    }
        
